import React from 'react';
import { PayPalScriptProvider, } from "@paypal/react-paypal-js";import './Css/App.css'
import PageComponent from './PageComponent.js'
import MenuBar from './MenuBar.js';
import ContactNavBar from './Contact.js';
import 'bootstrap/dist/css/bootstrap.min.css';
import PaymentJSX from './payment.js';
function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<MenuBar/>} />
        <Route path="/PageComponent" element={<PageComponent/>} /> 
        <Route path="/Contact" element={<ContactNavBar/>} /> 
        <PaymentJSX path="/Payment" element={<PaymentJSX/>}/> 
      </Routes>
    </BrowserRouter>
  );
}

export default App;
